def MotifCaller(motif_function, camera=True):
    delta = pglob.Tabs['motifs']['delta'].get()
    if camera:
        pglob.deletemotif()
        pglob.update()
    motif = globals()[motif_function](delta)
    objects = cmd.get_names('all')
    try:
        if motif != False:
            if type(motif).__name__ != 'dict':
                raise TypeError
            if motif['motif'] not in objects:
                raise Warning
            if cmd.count_atoms(motif['motif']) == 0:
                raise Warning
            if camera:
                pglob.procolor(motif['motif'], show_all='cartoon',
                    color_all='gray')
                if 'extra' in motif:
                    x = motif['extra']
                    xlen = range(len(x))
                    xkeys = x.keys()
                    xvals = x.values()
                    for l in xlen:
                        pglob.procolor(xvals[l], xkeys[l], show_all=None)
                cmd.orient(motif['motif'])
                cmd.deselect()
        else:
            raise Warning
    except TypeError:
        showerror('Type Error','The selected motif returned an incorrect type.'+
            'Expected a Dictionary.')
        return False
    except Warning:
        if camera:
            showinfo('Not Found','The selected motif did not return a result.')
        return False
    else:
        return True

def byResidue(selection, num, numtwo=None, lastselection=None):
    br = ''
    start, end = 1, num
    if numtwo != None:
        start, end = num, numtwo
    numbers = range(start, end+1)
    for number in numbers:
        if number == end:
            br = ''.join([br, 'br. ', selection, "%s"%(number)])
        else:
            br = ''.join([br, 'br. ', selection, "%s"%(number), '&'])
    cmd.select(selection, br)
    for number in numbers:
        delete = ''.join([selection, "%s"%(number)])
        cmd.delete(delete)
    if lastselection != None:
        cmd.set_name(selection,lastselection)

def P_1n8o_00(d):
    cmd.select('asp1', 'r. asp w. %s of r. his'%(d*3))
    cmd.select('asp2', 'r. asp w. %s of r. ser'%(d*7))
    byResidue('asp', 2)
    cmd.select('his1', 'r. his w. %s of asp'%(d*4))
    cmd.select('his2', 'r. his w. %s of r. ser'%(d*4))
    byResidue('his', 2)
    cmd.select('ser1', 'n. og w. %s of n. ne2'%(d*3.5))
    cmd.select('ser2', 'r. ser w. %s of asp'%(d*7))
    byResidue('ser', 2)
    cmd.select('P_1n8o_00', 'br. (ser|his|asp)')
    cmd.delete('ser')
    cmd.delete('his')
    cmd.delete('asp')
    return {'motif':'P_1n8o_00'}

